INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('26021232', 'Confit de canard', 'cuisses de canard, graisse de canard, sel. Conseils de préparation : Dans un premier temps, réchauffer la boite fermée 10 min au bain-marie, la passer sous l\'eau froide avant ouverture. Egoutter les cuisses. Au four : Mettre les cuisses dans un plat et dorer 10 min à four très chaud (préchauffage 15 min à thermostat 7). A la poêle : Disposer les cuisses côté peau, puis dorer de chaque côté dans un peu de graisse de canard. Conseils de conservation : A conserver à température ambiante. A consommer de préférence avant la date inscrite sur le dessus de la boîte. Après ouverture, à conserver au réfrigérateur et a consommer dans les 24 heures. Service consommateurs DSAS - BP 229 - 40282 St-Pierre-du-Mont cedex - France', '', '10.8', '8.2', '0.2', '0', '', '24', '1.5', '0.590551181102362', '', '0');

